import React from 'react'

export default function ForgotPassword() {
  return (
    <div>
         <span>New Password</span>
        <input type='text'value={email} onChange={(event)=>setEmail(event.target.value)} /><br/>
        <input type='button' value='Change Password' />
    </div>
  )
}
